import React from 'react'
import menu from './image/menu.png'
const Sidebar = () =>{
    const menuItem=[
        {
            path:"/",
            name:"Dashboard",
            img:'/src/image/menu.png'
            
        },
        {
            path:"/login",
            name:"Login",
           
        },
        {
            path:"/monetization",
            name:"Monetization",
           
        },
        {
            path:"/search",
            name:"Search",
           
        },
        {
            path:"/ads",
            name:"Ads",
           
        },
        {
            path:"/notification",
            name:"Notification",
           
        },
        {
            path:"/insights",
            name:"Insights",
           
        },
        {
            path:"/setting",
            name:"Setting",
           
        },
        {
            path:"/help",
            name:"Help",
           
           
        },
    ]
    
  return (
    <div className='container'>
        <div className='sidebar'>
            <div className='top_section'>
                <h1 className='logo'>Logo</h1>
                <div className='bars'>
                    <menu/>
                </div>
            </div>
        </div>
    </div>
  )
}

export default Sidebar
